INSERT INTO `markdowns` (`id`, `contentHTML`, `contentMarkdown`, `description`, `doctorId`, `specialtyId`, `clinicId`, `createdAt`, `updatedAt`) VALUES
(1, '<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Chuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn</li>\n<li>Chuyên khám và điều trị các bệnh lý Tai Mũi Họng trẻ em</li>\n<li>Nội soi Tai Mũi Họng</li>\n<li>Thực hiện các qui trình kỹ thuật Tai Mũi Họng</li>\n</ul>\n<p><strong>Các bệnh về tai</strong></p>\n<ul>\n<li>Ù tai, nghe kém, điếc đột ngột</li>\n<li>Chẩy mủ tai, viêm tai giữa cấp, mạn</li>\n<li>Vá màng nhĩ nội soi</li>\n<li>Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài</li>\n</ul>\n<p><strong>Các bệnh mũi xoang</strong></p>\n<ul>\n<li>Viêm mũi xoang dị ứng, viêm mũi vận mạch</li>\n<li>Viêm mũi ngạt tắc mũi mạn tính</li>\n<li>Viêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang</li>\n<li>Nấm mũi xoang</li>\n<li>Đau đầu mạn tính do mũi xoang…</li>\n</ul>\n', '**Khám và điều trị**\n* Chuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn\n* Chuyên khám và điều trị các bệnh lý Tai Mũi Họng trẻ em\n* Nội soi Tai Mũi Họng\n* Thực hiện các qui trình kỹ thuật Tai Mũi Họng\n\n**Các bệnh về tai**\n\n* Ù tai, nghe kém, điếc đột ngột\n* Chẩy mủ tai, viêm tai giữa cấp, mạn\n* Vá màng nhĩ nội soi\n* Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài\n\n**Các bệnh mũi xoang**\n\n* Viêm mũi xoang dị ứng, viêm mũi vận mạch\n* Viêm mũi ngạt tắc mũi mạn tính\n* Viêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang\n* Nấm mũi xoang\n* Đau đầu mạn tính do mũi xoang…\n', '\nGiám đốc chuyên môn Bệnh viện Đa khoa Quốc tế Nam Sài Gòn\nHơn 20 năm kinh nghiệm trong lĩnh vực Tai Mũi Họng\nBác sĩ nhận khám mọi độ tuổi', 15, NULL, NULL, '2024-04-11 12:04:07', '2024-04-11 12:08:31'),
(6, '<h5><strong>Thạc sĩ Chuyên khoa I Lê Thị Thu Hiền</strong></h5>\n<ul>\n<li>Nguyên Phó Trưởng khoa Tai mũi họng, Bệnh viện Giao thông vận tải</li>\n<li>Có nhiều năm kinh nghiệm công tác trong ngành Tai mũi họng</li>\n<li>Bác sĩ Chuyên khoa I Chuyên ngành Tai mũi họng</li>\n<li>Bằng sự nhẹ nhàng, tác phong làm việc chuyên nghiệp của mình Bác sĩ Huyền luôn mang lại cho người bệnh cảm giác yên tâm, thoải mái trong suốt quá trình thăm khám và điều trị</li>\n<li>Bác sĩ Huyền cũng tích cực nghiên cứu, học hỏi và áp dụng nhiều tiến bộ y học nhằm mang lại cho người bệnh hiệu quả điều trị cao nhất</li>\n</ul>\n<h5><strong>Khám và điều trị</strong></h5>\n<h6><strong>Các bệnh về tai</strong></h6>\n<ul>\n<li>Ù tai, nghe kém, điếc đột ngột</li>\n<li>Chẩy mủ tai, viêm tai giữa cấp, mạn</li>\n<li>Vá màng nhĩ nội soi</li>\n<li>Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài</li>\n<li>Viêm tai ngoài. nhọt ống tai, nút ráy tai</li>\n<li>Viêm tai giữa cấp, mạn</li>\n<li>Viêm tai xương chũm cấp, mạn và (hoặc không) biến chứng</li>\n<li>Rò luân nhĩ</li>\n<li>Rò khe nang</li>\n<li>Ù tai</li>\n<li>Tắc vòi nhĩ</li>\n<li>Viêm ống tai ngoài</li>\n<li>Nấm tai</li>\n</ul>\n<h6><strong>Các bệnh về mũi</strong></h6>\n<ul>\n<li>Viêm mũi xoang dị ứng, viêm mũi vận mạch</li>\n<li>Viêm mũi ngạt tắc mũi mạn tính</li>\n<li>Vêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang</li>\n<li>Nấm mũi xoang</li>\n<li>Đau đầu mạn tính do mũi xoang</li>\n<li>Viêm mũi họng mạn tính</li>\n<li>Khám và điều trị trĩ mũi</li>\n</ul>\n', '\n\n\n##### **Thạc sĩ Chuyên khoa I Lê Thị Thu Hiền**\n\n\n\n* Nguyên Phó Trưởng khoa Tai mũi họng, Bệnh viện Giao thông vận tải \n* Có nhiều năm kinh nghiệm công tác trong ngành Tai mũi họng\n* Bác sĩ Chuyên khoa I Chuyên ngành Tai mũi họng\n* Bằng sự nhẹ nhàng, tác phong làm việc chuyên nghiệp của mình Bác sĩ Huyền luôn mang lại cho người bệnh cảm giác yên tâm, thoải mái trong suốt quá trình thăm khám và điều trị\n* Bác sĩ Huyền cũng tích cực nghiên cứu, học hỏi và áp dụng nhiều tiến bộ y học nhằm mang lại cho người bệnh hiệu quả điều trị cao nhất\n\n\n\n#####  **Khám và điều trị**\n\n\n\n\n######  **Các bệnh về tai**\n\n\n\n* Ù tai, nghe kém, điếc đột ngột\n* Chẩy mủ tai, viêm tai giữa cấp, mạn\n* Vá màng nhĩ nội soi\n* Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài\n* Viêm tai ngoài. nhọt ống tai, nút ráy tai\n* Viêm tai giữa cấp, mạn\n* Viêm tai xương chũm cấp, mạn và (hoặc không) biến chứng\n* Rò luân nhĩ\n* Rò khe nang \n* Ù tai \n* Tắc vòi nhĩ \n* Viêm ống tai ngoài \n* Nấm tai\n\n\n\n######  **Các bệnh về mũi**\n\n\n\n* Viêm mũi xoang dị ứng, viêm mũi vận mạch\n* Viêm mũi ngạt tắc mũi mạn tính\n* Vêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang\n* Nấm mũi xoang\n* Đau đầu mạn tính do mũi xoang\n* Viêm mũi họng mạn tính\n* Khám và điều trị trĩ mũi', 'Có nhiều năm kinh nghiệm công tác trong ngành Tai Mũi Họng', 10, NULL, NULL, '2024-04-11 17:30:37', '2024-04-12 16:30:24'),
(7, '<h5><strong>Tiến sĩ, Bác sĩ chuyên khoa II Nguyễn Duy Hưng</strong></h5>\n<ul>\n<li>Hơn 30 năm kinh nghiệm khám và điều trị các bệnh nội cơ xương khớp và 40 năm kinh nghiệm khám Nội tổng quát</li>\n<li>Giám đốc Phòng khám Tổ hợp Y tế Mediplus</li>\n<li>Nguyên Phó Giám đốc Bệnh viện E</li>\n<li>Bác sĩ nhận khám bệnh nhân từ 16 tuổi trở lên</li>\n</ul>\n<h5><strong>Khám và điều trị</strong></h5>\n<ul>\n<li>Thoái hóa đa khớp ( cột sống thắt lưng, cột sống cổ, khớp gối, khớp háng..)</li>\n<li>Loãng xương</li>\n<li>Viêm khớp dạng thấp</li>\n<li>Đau thần kinh tọa</li>\n<li>Gout</li>\n<li>Thực hiện tiêm khớp, tiêm ngoài màng cứng, hút dịch khớp, tiêm huyết tương giàu tiểu cầu</li>\n<li>Khám gói khám chuyên khoa Nội tổng quát cho cá nhân</li>\n</ul>\n<h5><strong>Quá trình công tác</strong></h5>\n<ul>\n<li>Giám đốc Phòng khám, Tổ hợp y tế Mediplus (2020 - nay)</li>\n<li>Tiến sĩ Nội xương khớp, Bệnh viện E (2017 - 2018)</li>\n<li>Bác sỹ chính, Bệnh viện E (2016 - 2017)</li>\n<li>Giám đốc Trung tâm Cơ Xương khớp, Bệnh viện E (2010 - 2016)</li>\n<li>Phó giám đốc bệnh viện, Bệnh viện E (2008 - 2010)</li>\n<li>Trưởng phòng Tổ chức cán bộ, Bệnh viện E (2007 - 2008)</li>\n<li>Phó phòng Tổ chức cán bộ, Bệnh viện E (2004 - 2007)</li>\n<li>Phó trưởng khoa Cơ Xương khớp, Bệnh viện E (1997 - 1999)</li>\n<li>Phó trưởng phòng Kế hoach tổng hợp-Bác sĩ tim mach, Bệnh viện E (1994 - 1997)</li>\n<li>Bác sĩ nội khoa truyền nhiễm, Bệnh viện E (1986 - 1994)</li>\n</ul>\n<h5><strong>Quá trình đào tạo</strong></h5>\n<ul>\n<li>Tiến sĩ Nội xương khớp, Bệnh viện E (2018)</li>\n<li>Bác sĩ Chuyên khoa II, Học viện Quân Y (2004)</li>\n<li>Tốt nghiệp Đại học Y Hà Nội (1986)</li>\n</ul>\n<h5><strong>Sách và các công trình nghiên cứu, báo cáo khoa học</strong></h5>\n<ul>\n<li>Tràn dịch khớp gối (Đề tài nguyên cứu Chuyên khoa II và Tiến sĩ)</li>\n<li>Sách giảng dạy về y tế trong chuyên ngành y tế hay giáo dục sức khỏe tại Bệnh viện E</li>\n<li>Các bài báo cáo về lao khớp, viêm khớp dạng thấp, thoái hóa khớp</li>\n</ul>\n', '\n##### **Tiến sĩ, Bác sĩ chuyên khoa II Nguyễn Duy Hưng**\n* Hơn 30 năm kinh nghiệm khám và điều trị các bệnh nội cơ xương khớp và 40 năm kinh nghiệm khám Nội tổng quát\n* Giám đốc Phòng khám Tổ hợp Y tế Mediplus\n* Nguyên Phó Giám đốc Bệnh viện E\n* Bác sĩ nhận khám bệnh nhân từ 16 tuổi trở lên\n\n\n##### **Khám và điều trị**\n* Thoái hóa đa khớp ( cột sống thắt lưng, cột sống cổ, khớp gối, khớp háng..)\n* Loãng xương\n* Viêm khớp dạng thấp\n* Đau thần kinh tọa\n* Gout\n* Thực hiện tiêm khớp, tiêm ngoài màng cứng, hút dịch khớp, tiêm huyết tương giàu tiểu cầu\n* Khám gói khám chuyên khoa Nội tổng quát cho cá nhân\n\n\n##### **Quá trình công tác**\n* Giám đốc Phòng khám, Tổ hợp y tế Mediplus (2020 - nay)\n* Tiến sĩ Nội xương khớp, Bệnh viện E (2017 - 2018)\n* Bác sỹ chính, Bệnh viện E (2016 - 2017)\n* Giám đốc Trung tâm Cơ Xương khớp, Bệnh viện E (2010 - 2016)\n* Phó giám đốc bệnh viện, Bệnh viện E (2008 - 2010)\n* Trưởng phòng Tổ chức cán bộ, Bệnh viện E (2007 - 2008)\n* Phó phòng Tổ chức cán bộ, Bệnh viện E (2004 - 2007)\n* Phó trưởng khoa Cơ Xương khớp, Bệnh viện E (1997 - 1999)\n* Phó trưởng phòng Kế hoach tổng hợp-Bác sĩ tim mach, Bệnh viện E (1994 - 1997)\n* Bác sĩ nội khoa truyền nhiễm, Bệnh viện E (1986 - 1994)\n\n\n##### **Quá trình đào tạo**\n* Tiến sĩ Nội xương khớp, Bệnh viện E (2018)\n* Bác sĩ Chuyên khoa II, Học viện Quân Y (2004)\n* Tốt nghiệp Đại học Y Hà Nội (1986)\n\n\n##### **Sách và các công trình nghiên cứu, báo cáo khoa học**\n* Tràn dịch khớp gối (Đề tài nguyên cứu Chuyên khoa II và Tiến sĩ)\n* Sách giảng dạy về y tế trong chuyên ngành y tế hay giáo dục sức khỏe tại Bệnh viện E\n* Các bài báo cáo về lao khớp, viêm khớp dạng thấp, thoái hóa khớp\n\n', 'Hơn 30 năm kinh nghiệm khám và điều trị các bệnh nội cơ xương khớp và 40 năm kinh nghiệm khám Nội tổng quát\nNguyên Phó Giám đốc Bệnh viện E\nBác sĩ nhận khám bệnh nhân từ 4 tuổi trở lên', 14, NULL, NULL, '2024-04-13 11:26:48', '2024-04-13 11:26:48'),
(8, '<h5><strong>Tiến sĩ, Bác sĩ Trịnh Thị Khanh</strong></h5>\n<ul>\n<li>Nguyên Phó Trưởng khoa Thần kinh, Bệnh viện Hữu Nghị</li>\n<li>Hơn 32 năm kinh nghiệm trong lĩnh vực Thần kinh</li>\n</ul>\n<h5><strong>Khám và điều trị</strong></h5>\n<ul>\n<li>Các bệnh đau đầu: Chứng đau nửa đầu, đau đầu căn nguyên mạch máu, đau đầu mạn tính hàng ngày,..</li>\n<li>Bệnh đau vai gáy do thoái hóa cột sống cổ, thoát vị đĩa đệm cột sống cổ, …</li>\n<li>Đau thắt lưng hông do thoái hóa, thoát vị, đau do viêm khớp cùng chậu…</li>\n<li>Rối loạn tiền đình</li>\n<li>Điều trị chóng mặt do thiếu máu não</li>\n<li>Tư vấn và điều trị các bệnh lý rối loạn về giấc ngủ: mất ngủ cấp tính hoặc mạn tính</li>\n<li>Liệt dây 7 ngoại vi: Viêm các dây thần kinh sọ não và các dây thần kinh ngoại vi khác như hội chứng ống cổ tay, đau vai khuỷu tay do chơi thể thao</li>\n<li>Liệt nửa người do nhồi máu não</li>\n<li>Các bệnh lý về sa sút trí tuệ: Suy giảm nhận thức nhẹ, suy giảm trí nhớ, sa sút trí tuệ nguyên nhân mạch máu (sa sút trí tuệ sau đột quỵ),Alzheimer</li>\n<li>Bệnh rối loạn vận động như bệnh Parkinson</li>\n</ul>\n<h5><strong>Quá trình đào tạo</strong></h5>\n<ul>\n<li>Tốt nghiệp Tiến sĩ y khoa (2004)</li>\n<li>Tốt nghiệp Thạc sĩ (1996)</li>\n<li>Bác sĩ Chuyên khoa cấp I, Trường Đại học Y Hà Nội (1987)</li>\n<li>Tốt nghiệp Đại học y Hà Nội (1984)</li>\n</ul>\n<h5><strong>Quá trình công tác</strong></h5>\n<ul>\n<li>Phó Trưởng khoa Thần kinh, Bệnh viện Hữu Nghị (2007 – 2014)</li>\n<li>Phó Trưởng khoa Cấp cứu, Bệnh viện Hữu Nghị (2003 – 2007)</li>\n<li>Từng công tác tại khoa Hồi sức cấp cứu bệnh viện Hữu Nghị</li>\n<li>Từng công tác tại khoa Khám chữa bệnh bệnh viện Hữu Nghị</li>\n</ul>\n', '\n##### **Tiến sĩ, Bác sĩ Trịnh Thị Khanh**\n\n* Nguyên Phó Trưởng khoa Thần kinh, Bệnh viện Hữu Nghị\n* Hơn 32 năm kinh nghiệm trong lĩnh vực Thần kinh\n\n##### **Khám và điều trị**\n\n* Các bệnh đau đầu: Chứng đau nửa đầu, đau đầu căn nguyên mạch máu, đau đầu mạn tính hàng ngày,..\n* Bệnh đau vai gáy do thoái hóa cột sống cổ, thoát vị đĩa đệm cột sống cổ, …\n* Đau thắt lưng hông do thoái hóa, thoát vị, đau do viêm khớp cùng chậu…\n* Rối loạn tiền đình\n* Điều trị chóng mặt do thiếu máu não\n* Tư vấn và điều trị các bệnh lý rối loạn về giấc ngủ: mất ngủ cấp tính hoặc mạn tính\n* Liệt dây 7 ngoại vi: Viêm các dây thần kinh sọ não và các dây thần kinh ngoại vi khác như hội chứng ống cổ tay, đau vai khuỷu tay do chơi thể thao\n* Liệt nửa người do nhồi máu não\n* Các bệnh lý về sa sút trí tuệ: Suy giảm nhận thức nhẹ, suy giảm trí nhớ, sa sút trí tuệ nguyên nhân mạch máu (sa sút trí tuệ sau đột quỵ),Alzheimer\n* Bệnh rối loạn vận động như bệnh Parkinson\n\n##### **Quá trình đào tạo**\n\n* Tốt nghiệp Tiến sĩ y khoa (2004)\n* Tốt nghiệp Thạc sĩ (1996)\n* Bác sĩ Chuyên khoa cấp I, Trường Đại học Y Hà Nội (1987)\n* Tốt nghiệp Đại học y Hà Nội (1984)\n\n##### **Quá trình công tác**\n\n* Phó Trưởng khoa Thần kinh, Bệnh viện Hữu Nghị (2007 – 2014)\n* Phó Trưởng khoa Cấp cứu, Bệnh viện Hữu Nghị (2003 – 2007)\n* Từng công tác tại khoa Hồi sức cấp cứu bệnh viện Hữu Nghị\n* Từng công tác tại khoa Khám chữa bệnh bệnh viện Hữu Nghị', 'Nguyên Phó Trưởng khoa Thần kinh, Bệnh viện Hữu Nghị\nNguyên Phó Trưởng khoa Hồi sức cấp cứu, Bệnh viện Hữu Nghị\nHơn 32 năm kinh nghiệm trong lĩnh vực Thần kinh', 13, NULL, NULL, '2024-04-13 11:31:11', '2024-04-13 11:31:11'),
(9, '<h5><strong>Bác sĩ Chuyên khoa II Nguyễn Thị Bạch Liễu</strong></h5>\n<ul>\n<li>Hơn 30 năm kinh nghiệm trong khám và điều trị các bệnh lý Tiêu hóa</li>\n<li>Từng công tác nhiều năm tại Bệnh viện Quân Y 103</li>\n<li>Nguyên giảng viên Học viện Quân Y</li>\n<li>Bác sĩ khám cho bệnh nhân trên 12 tuổi</li>\n<li></li>\n</ul>\n<h5><strong>Khám và điều trị</strong></h5>\n<ul>\n<li>Bác sĩ khám và điều trị các bệnh lý vể Tiêu hóa:</li>\n<li>Khám và điều trị các bệnh của dạ dày tá tràng như viêm loét dạ dày tá tràng, viêm loét thực quản.</li>\n<li>Phát hiện ung thư dạ dày, thực quản,...</li>\n<li>Khám và điều trị các bệnh của đại tràng như viêm đại tràng, bệnh trĩ, phát hiện ung thư đại tràng và thư vấn điều trị chuyên khoa.</li>\n<li>Khám và điều trị bệnh xơ gan, phòng ngừa biến chứng của xơ gan, hạn chế diễn tiến nặng của xơ gan.</li>\n<li>Các bệnh lý của gan, mật</li>\n</ul>\n<h5><strong>Quá trình công tác</strong></h5>\n<ul>\n<li>Hiện là Bác sĩ khám và điều trị Nội Tiêu hóa, Bệnh viện Đa khoa Chữ Thập Xanh</li>\n<li>Bác sĩ điều trị tại Bệnh viện Quân Y 103 (1990 - 2021)</li>\n<li>Giảng viên Học viện Quân Y (1990 - 2021)</li>\n</ul>\n<h5><strong>Quá trình đào tạo</strong></h5>\n<ul>\n<li>Tốt nghiệp Bác sĩ chuyên khoa II chuyên ngành Nội Tiêu hóa, Học viện Quân Y (2010)</li>\n<li>Tốt nghiệp Bác sĩ chuyên khoa I chuyên ngành Nội chung, Học viện Quân Y (1996)</li>\n<li>Tốt nghiệp Bác sĩ Đa khoa, Học viện Quân Y (1990)</li>\n</ul>\n', '\n##### **Bác sĩ Chuyên khoa II Nguyễn Thị Bạch Liễu**\n\n* Hơn 30 năm kinh nghiệm trong khám và điều trị các bệnh lý Tiêu hóa\n* Từng công tác nhiều năm tại Bệnh viện Quân Y 103\n* Nguyên giảng viên Học viện Quân Y\n* Bác sĩ khám cho bệnh nhân trên 12 tuổi\n*\n\n##### **Khám và điều trị**\n\n* Bác sĩ khám và điều trị các bệnh lý vể Tiêu hóa:\n* Khám và điều trị các bệnh của dạ dày tá tràng như viêm loét dạ dày tá tràng, viêm loét thực quản.\n* Phát hiện ung thư dạ dày, thực quản,...\n* Khám và điều trị các bệnh của đại tràng như viêm đại tràng, bệnh trĩ, phát hiện ung thư đại tràng và thư vấn điều trị chuyên khoa.\n* Khám và điều trị bệnh xơ gan, phòng ngừa biến chứng của xơ gan, hạn chế diễn tiến nặng của xơ gan.\n* Các bệnh lý của gan, mật\n\n\n##### **Quá trình công tác**\n\n* Hiện là Bác sĩ khám và điều trị Nội Tiêu hóa, Bệnh viện Đa khoa Chữ Thập Xanh \n* Bác sĩ điều trị tại Bệnh viện Quân Y 103 (1990 - 2021)\n* Giảng viên Học viện Quân Y (1990 - 2021)\n\n##### **Quá trình đào tạo**\n\n* Tốt nghiệp Bác sĩ chuyên khoa II chuyên ngành Nội Tiêu hóa, Học viện Quân Y (2010)\n* Tốt nghiệp Bác sĩ chuyên khoa I chuyên ngành Nội chung, Học viện Quân Y (1996)\n* Tốt nghiệp Bác sĩ Đa khoa, Học viện Quân Y (1990)', 'Hơn 30 năm kinh nghiệm trong khám và điều trị các bệnh lý Tiêu hóa\nTừng công tác nhiều năm tại Bệnh viện Quân Y 103\nNguyên giảng viên Học viện Quân Y\nBác sĩ khám cho bệnh nhân trên 12 tuổi', 12, NULL, NULL, '2024-04-13 11:35:05', '2024-04-13 11:35:05'),
(10, '<h5><strong>Bác sĩ Chuyên khoa I Võ Quang Thành</strong></h5>\n<ul>\n<li>Bác sĩ khoa Ngoại Thần kinh – Cột sống, Bệnh viện STO Phương Đông.</li>\n</ul>\n<h5><strong>Quá trình công tác</strong></h5>\n<ul>\n<li>Bác sĩ khoa Ngoại Thần kinh – Cột sống, Bệnh viện STO Phương Đông (T3/2013 - nay)</li>\n<li>Bác sĩ thực tập khoa Ngoại Thần kinh, Bệnh viện Chợ Rẫy (2008 - 2010)</li>\n</ul>\n<h5><strong>Quá trình đào tạo</strong></h5>\n<ul>\n<li>Tốt nghiệp Bác sĩ Đa khoa - Học viện Quân Y (2008)</li>\n<li>Tốt nghiệp Bác sỹ Chuyên khoa cấp I Ngoại Thần kinh, Đại học Y dược TPHCM (2012)</li>\n<li>Tu nghiệp chuyên môn tại Hàn Quốc năm 2013</li>\n</ul>\n<h5><strong>Khám và điều trị</strong></h5>\n<ul>\n<li>Các Bệnh lý Cơ xương khớp và Cột sống</li>\n<li>Thoái hoá xương khớp</li>\n<li>Viêm khớp</li>\n<li>Loãng xương</li>\n<li>Chấn thương xương khớp</li>\n<li>Đau cột sống lưng</li>\n<li>Đau vai gáy</li>\n<li>Điều trị giảm đau không cần phẫu thuật:</li>\n<li>Thoái hoá và thoát vị đĩa đệm giai đoạn sớm</li>\n<li>Tái tạo khớp trong bệnh lý thoái hoá</li>\n<li>Điều trị đau sau phẫu thuật</li>\n<li>Điều trị đau do viêm khớp</li>\n<li>Phong bế dây thần kinh chọn lọc</li>\n<li>Phong bế khớp</li>\n</ul>\n<h5><strong>Điều trị phẫu thuật</strong></h5>\n<ul>\n<li>Thoát vị đĩa đệm nặng</li>\n<li>Trượt đốt sống</li>\n<li>Vẹo cột sống</li>\n<li>Gãy cột sống</li>\n<li>Thay đĩa đệm nhân tạo cột sống</li>\n</ul>\n', '\n##### **Bác sĩ Chuyên khoa I Võ Quang Thành**\n\n* Bác sĩ khoa Ngoại Thần kinh – Cột sống, Bệnh viện STO Phương Đông.\n\n\n##### **Quá trình công tác**\n\n* Bác sĩ khoa Ngoại Thần kinh – Cột sống, Bệnh viện STO Phương Đông (T3/2013 - nay)\n* Bác sĩ thực tập khoa Ngoại Thần kinh, Bệnh viện Chợ Rẫy (2008 - 2010)\n\n##### **Quá trình đào tạo**\n\n* Tốt nghiệp Bác sĩ Đa khoa - Học viện Quân Y (2008)\n* Tốt nghiệp Bác sỹ Chuyên khoa cấp I Ngoại Thần kinh, Đại học Y dược TPHCM (2012)\n* Tu nghiệp chuyên môn tại Hàn Quốc năm 2013\n\n\n##### **Khám và điều trị**\n\n\n* Các Bệnh lý Cơ xương khớp và Cột sống\n* Thoái hoá xương khớp\n* Viêm khớp\n* Loãng xương\n* Chấn thương xương khớp\n* Đau cột sống lưng\n* Đau vai gáy\n* Điều trị giảm đau không cần phẫu thuật:\n* Thoái hoá và thoát vị đĩa đệm giai đoạn sớm\n* Tái tạo khớp trong bệnh lý thoái hoá\n* Điều trị đau sau phẫu thuật\n* Điều trị đau do viêm khớp\n* Phong bế dây thần kinh chọn lọc\n* Phong bế khớp\n\n##### **Điều trị phẫu thuật**\n\n\n* Thoát vị đĩa đệm nặng\n* Trượt đốt sống\n* Vẹo cột sống\n* Gãy cột sống\n* Thay đĩa đệm nhân tạo cột sống', 'Bác sĩ khoa Ngoại Thần kinh – Cột sống, Bệnh viện STO Phương Đông.', 11, NULL, NULL, '2024-04-13 11:38:03', '2024-04-13 11:38:03');

